window.bookSummaryJSON = "<p>It's 1821, and pirate legend Jose' Gasparilla and his crew are about to split their treasure and retire. One more prize on the horizon lures the crew to back to action, but they fall into a trap set by the fledgling US Navy. A new leader rises from the defeat and with the few remaining men and the treasure, they make a run for it. Follow their adventure as they make their way through unexplored Florida to the Keys.</p>"; 
